import React from 'react'
import Navbar from './navbar';
import '../css-components/productsNew.css';

const ProductsNew = () => {

    const makerEQUEST = async () => {
        const nombre = document.querySelector('input[placeholder="Name"]').value;
        const correo = document.querySelector('input[placeholder="Email"]').value;
        const telefono = document.querySelector('input[placeholder="Telefono"]').value;
        const rut = document.querySelector('input[placeholder="RUT"]').value;
        const direcion = document.querySelector('input[placeholder="Direccion"]').value
        const contra = document.querySelector('input[placeholder="Password"]').value

        const datos = {
          nombre: nombre,
          correo: correo,
          telefono: telefono,
          rut: rut,
          direccion : direcion,
          contra : contra
        };
    

        try {
          const res = await fetch("http://127.0.0.1:5000/registro", {
            method: "POST",
            body: JSON.stringify(datos),
            headers: {
              "Content-Type": "application/json"
            }
          });
          const data = await res.json();

          if (data.message == "si"){
            window.location = "/login";
          }else{
            alert("Error en el registro")

          } 
        } catch (error) {
            alert("Registro exitoso!")
        }
      };
      const handleSubmit = (event) => {
        event.preventDefault(); // Evitar que el formulario se envíe normalmente
        makerEQUEST(); // Llamar a la función makerEQUEST cuando se presiona el botón
      };

  return (
    <div>
        <Navbar/>
        <h1>Nuevo Producto</h1>
        <form id='formulario' onSubmit={handleSubmit}>
            <div className='container' id='cont'>
                <div className='form-group'>
                    <label>Nombre Producto</label>
                    <input type='email' className='form-control' placeholder='Nombre...'/>
                <div/>
                <div className='form-group'>
                    <label>Categoria</label>
                    <input type='password' className='form-control' placeholder='Categoria...'/>
                </div>
                <div className='form-group'>
                    <label>Precio</label>
                    <input type='' className='form-control' placeholder='Precio...'/>
                </div>
                <div className='form-group'>
                    <label>Talla</label>
                    <input type='' className='form-control' placeholder='Talla...'/>
                </div>
                <div className='form-group'>
                    <label>Género</label>
                    <input type='' className='form-control' placeholder='Genero...'/>
                </div>
                <div className='form-group'>
                    <label>Marca</label>
                    <input type='' className='form-control' placeholder='Marca...'/>
                </div>
                <div className='form-group'> 
                    <label>Código</label>
                    <input class="form-control" type="file" id="formFile"/>
                </div>
                <div className='form-group'>
                    <label>Disponible</label>
                    <div class="form-check form-check-inline" id='casilla'>
                        <input class="form-check-input" type="radio" name="inlineRadioOptions" id="inlineRadio1" value="option1"/>
                        <label class="form-check-label" for="inlineRadio1">Si</label>
                    </div>
                    <div class="form-check form-check-inline" >
                        <input class="form-check-input" type="radio" name="inlineRadioOptions" id="inlineRadio2" value="option2"/>
                        <label class="form-check-label" for="inlineRadio2">No</label>
                    </div>
                </div>
                </div>
            </div>
        </form>
    </div>
  )
};

export default ProductsNew;
